import React from "react";
import styled from "styled-components";

const GifBackground = styled.div`
    background-image: url("https://giphy.com/embed/RNlgWpfnRNRGBES99r/video");
    background-size: cover;
    height: 100vh;
    padding: 0;
    margin: 0;
`;

const UserList = () => {
    return <div>
      <div style="width:480px"><iframe allow="fullscreen" frameBorder="0" height="267" src="https://giphy.com/embed/RNlgWpfnRNRGBES99r/video" width="480"></iframe></div>
    </div>;
};

export default UserList;
